Message:
增加ES5中reduce方法对数组空位的处理

```js
[1,,2].reduce((x,y)=>{
  console.log(x,y)
  return x+y
})
// 输出
// 1 2
// 3
```

修正querySelectorAll返回的NodeList集合不能使用forEach方法遍历的描述

修正querySelectorAll返回的NodeList集合不能使用forEach方法遍历的描述.
1.在chrome中querySelectorAll返回的NodeList集合可以使用forEach方法遍历
2.document.querySelectorAll('td').forEach(function (p) {
  console.log(p instanceof Object);
});
输出:
6 true
undefined

修复类的静态属性中实例代码的错误

class MyClass {
  static myStaticProp = 42;

  constructor() {
    console.log(MyClass.myProp); // 42
  }
}
修改为：
class MyClass {
  static myStaticProp = 42;

  constructor() {
    console.log(MyClass.myStaticProp); // 42
  }
}

此处参数有误

// Reflect.construct 的写法
const instance = Reflect.construct(Greeting, '张三');
Reflect.construct(target, argumentsList[, newTarget])
An array-like object specifying the arguments with which target should be called.

Update object.md

const descriptor = Object.getOwnPropertyDescriptor(o, 'foo');
==>
const descriptor = Object.getOwnPropertyDescriptor(obj, 'foo');

fix: IIFE 不一定是匿名

(function a() {
  console.log('aaa');
}());

修正一个“类的实例对象”节 的错误：“它们的原型都是Point”

“类的实例对象 ”中举的例子 
var p1 = new Point(2,3);
var p2 = new Point(3,2);

p1.__proto__ === p2.__proto__
//true

上面代码中，p1和p2都是Point的实例，它们的原型都是Point，所以__proto__属性是相等的。

Update function.md

勘误。line:766
原：return person.first + ' ' + person.name;
改：return person.first + ' ' + person.last;
